import React from 'react';
import { View, Image, Text } from "react-native";



const MapCard = ({name, level, id}) => {
  return (

    <View id={id}>
        <Image source={require('../../../public/img/indoor-map.jpg')}/>
      <View>
      <Text>{name}</Text>
      <Text>{level}</Text>
      </View>
    </View>

  );
}

export default MapCard;
